<link rel="preconnect" href="https://fonts.googleapis.com"><link rel="preconnect" href="https://fonts.gstatic.com" crossorigin><link href="https://fonts.googleapis.com/css2?family=Inter:wght@600&display=swap" rel="stylesheet"><style>body {
    font-family: 'Inter', 'sans serif';
    background-color: #121212;
    color: white;
    font-size: 10px;
  }

  p {
    font-weight: 600;
    color: rgb(200, 200, 200);
  }

  #ui {
    border-left: 1px solid rgba(60, 60, 60);
    position: absolute;
    float: left;
    top: 0;
    right: 0;
    height: 100vh;
    width: 25vw;
    text-align: left;
  }

  /* Menu */
  nav {
    border-bottom: 1px #333 solid;
  }

  ul {
    list-style: none;
    display: flex;
    padding: 0px;
    justify-content: center;
  }

  li {
    padding: 6px 12px;
    cursor: pointer;
    font-weight: 600;
  }

  /* Scene */
  #scene, #settings {
    padding-left: 10px;
  }

  .scrollable-div {
    width: 165px;
    height: 325px;
    overflow: auto;
  }

  .scrollable-div::-webkit-scrollbar {
    width: 10px;
  }

  .scrollable-div::-webkit-scrollbar-thumb {
    background-color: white;
    border-radius: 20px;
  }

  input[type=number]::-webkit-inner-spin-button { 
    -webkit-appearance: none;
    
  }

  input[type=number] { 
    -moz-appearance: textfield;
    appearance: textfield;

  }

  .input {
    display: flex;
    align-items: center;
  }
  
  .input_element {
    border: none;
    outline: none;
    padding: 8px;
    padding-right: 0;
    margin: 0;
    justify-self: stretch;
    min-width: 0;
    border-radius: 2px;
    transition: box-shadow 0.3s ease;
    background-color: rgba(var(--rgbSurface));
    height: 32px;
    width: 100%;
    color: rgba(200, 200, 200);
  }

  /* Settings */
  input[type=checkbox] {
    position: relative;
    cursor: pointer;
    width: 33px;
    height: 19px;
  }

  input[type=checkbox]::before, input[type=checkbox]::after {
    content: "";
    position: absolute;
    top: 0;
    left: 0;
    transition: left .15s cubic-bezier(.25, .8, .25, .1), transform .15s ease-in;
  }

  input[type=checkbox]::before {
    background-color: #ccc;
    width: 100%;
    height: 100%;
    border-radius: 28px;
  }

  input[type=checkbox]::after {
    margin: 2px 0 0 2px;
    background: #fff;
    width: 15px;
    height: 15px;
    border-radius: 100%;
  }

  input[type=checkbox]:checked::before {
    background-color: #18a0fb;
  }

  input[type=checkbox]:checked::after {
    left: 14px;
  }

  label {
    color: #979797;
    font-size: 12px;
  }

  .color {
    appearance: none;
    border: none;
    cursor: pointer;
    background-color: transparent;
    width: 25px;
    height: 25px;
  }

  .color::-webkit-color-swatch {
    border: none;
    border-radius: 3px;
  }  

  .inputColor {
    width: 100%;
    text-align: right;
    padding: 0 10 0 10;
  }

  /* Buttons */
  #float-button {
    position: absolute;
    bottom: 10px;
  }

  button {
    border-radius: 25px;
    padding: 8px 15px;
    margin: 10px 10px;
    color: white;
  }
    
  #apply {
    background-color: #18a0fb;
    border: 1px #18a0fb solid;
    box-shadow: none;
  }
    
  #close {
    background-color: black;
    border: 1px #333 solid;
    box-shadow: inset 0 0 0 1px black;
  }

  /* TheeJS */
  #threeJS {
    position: absolute;
    float: right;
